import React from 'react';
import './trackCard.css'; // Add this line

const TrackCard = ({ imageSrc, artistName, trackName, position }) => (
  <div className="track-card">
    <img src={imageSrc} alt={`Artist ${artistName}`} />
    <h3>{artistName}</h3>
    <h3>{trackName}</h3>
    <p>{position}</p>
  </div>
);

export default TrackCard;
